import tickets from "../../public/movie_tickets.jpg";

export default function Home() {
  return (
    <section className="hero">
      <div className="hero-body">
        <p className="title">Home</p>
        <div className="content">
          <img src={tickets} alt="tickets" />
        </div>
      </div>
    </section>
  );
}
